import { useState } from "react";
import { FiMaximize2, FiX } from "react-icons/fi";
import interior1 from 'C:/Users/PC/Desktop/Abhi/Cinegraphics-main/frontend/src/assets/interior/interior1.jpg';
import interior2 from 'C:/Users/PC/Desktop/Abhi/Cinegraphics-main/frontend/src/assets/interior/interior2.jpg';
import interior3 from 'C:/Users/PC/Desktop/Abhi/Cinegraphics-main/frontend/src/assets/interior/interior3.jpg';
import interior4 from 'C:/Users/PC/Desktop/Abhi/Cinegraphics-main/frontend/src/assets/interior/interior4.jpg';
import interior5 from 'C:/Users/PC/Desktop/Abhi/Cinegraphics-main/frontend/src/assets/interior/interior5.jpg';
import interior6 from 'C:/Users/PC/Desktop/Abhi/Cinegraphics-main/frontend/src/assets/interior/interior6.jpg';
import interior7 from 'C:/Users/PC/Desktop/Abhi/Cinegraphics-main/frontend/src/assets/interior/interior7.jpg';
import interior8 from 'C:/Users/PC/Desktop/Abhi/Cinegraphics-main/frontend/src/assets/interior/interior8.jpg';
import interior9 from 'C:/Users/PC/Desktop/Abhi/Cinegraphics-main/frontend/src/assets/interior/interior9.jpg';
import interior10 from 'C:/Users/PC/Desktop/Abhi/Cinegraphics-main/frontend/src/assets/interior/interior10.jpg';
import './Interior.css';

const Interior = () => {
  const [selectedImage, setSelectedImage] = useState(null);

  const galleryItems = [
    { id: 1, title: "Title", description: "Description", imageUrl: interior1 },
    { id: 2, title: "Title", description: "Description", imageUrl: interior2 },
    { id: 3, title: "Title", description: "Description", imageUrl: interior3 },
    { id: 4, title: "Title", description: "Description", imageUrl: interior4 },
    { id: 5, title: "Title", description: "Description", imageUrl: interior5 },
    { id: 6, title: "Title", description: "Description", imageUrl: interior6 },
    { id: 7, title: "Title", description: "Description", imageUrl: interior7 },
    { id: 8, title: "Title", description: "Description", imageUrl: interior8 },
    { id: 9, title: "Title", description: "Description", imageUrl: interior9 },
    { id: 10, title: "Title", description: "Description", imageUrl: interior10 },
  ];

  const handleImageClick = (image) => setSelectedImage(image);
  const handleCloseLightbox = () => setSelectedImage(null);

  return (
    <div className="mx-4 md:mx-[8.5rem]">
      <h1 className="mt-12 font-cairo font-medium text-3xl md:text-5xl text-left">
        Interior Design
      </h1>
      <div className="mt-4 py-8">
        <div className="grid grid-cols-1 md:grid-cols-3 lg:grid-cols-4 gap-4 auto-rows-[300px]">
          {galleryItems.map((item) => (
            <div
              key={item.id}
              className="relative group overflow-hidden rounded-lg cursor-pointer"
              onClick={() => handleImageClick(item)}
            >
              <img
                src={item.imageUrl}
                alt={item.title}
                className="w-full h-full object-cover transition-transform duration-300 group-hover:scale-110"
                onError={(e) => {
                  e.target.src = "https://images.unsplash.com/photo-1682686580186-b55d2a91053c";
                  e.target.alt = "Fallback Image";
                }}
              />
              <div className="absolute inset-0 bg-black bg-opacity-0 group-hover:bg-opacity-40 transition-all duration-300">
                <div className="absolute bottom-0 left-0 right-0 p-4 text-white transform translate-y-full group-hover:translate-y-0 transition-transform duration-300">
                  <h3 className="text-sm md:text-lg font-semibold">{item.title}</h3>
                  <p className="text-xs md:text-sm">{item.description}</p>
                </div>
                <FiMaximize2 className="absolute top-2 md:top-4 right-2 md:right-4 text-white opacity-0 group-hover:opacity-100 transition-opacity duration-300" size={20} />
              </div>
            </div>
          ))}
        </div>
        {selectedImage && (
          <div className="fixed inset-0 bg-black bg-opacity-90 flex items-center justify-center z-50">
            <div className="relative w-full max-w-md sm:max-w-4xl mx-4">
              <button
                className="absolute top-2 md:top-4 right-2 md:right-4 text-white hover:text-gray-300 transition-colors duration-300"
                onClick={handleCloseLightbox}
              >
                <FiX size={24} />
              </button>
              <img
                src={selectedImage.imageUrl}
                alt={selectedImage.title}
                className="w-full h-auto rounded-lg"
                onError={(e) => {
                  e.target.src = "https://images.unsplash.com/photo-1682686580186-b55d2a91053c";
                  e.target.alt = "Fallback Image";
                }}
              />
              <div className="mt-4 text-white text-center sm:text-left">
                <h2 className="text-lg sm:text-2xl font-bold">{selectedImage.title}</h2>
                <p className="mt-2 text-sm sm:text-base">{selectedImage.description}</p>
              </div>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default Interior;
